<?php

namespace Controllers;

class User{
    public function login(\Base $base){
        include ('app/Views/User/login.html');
    }

    public function addUser(\Base $base, array $args = []){
        $username = $args['username'];
        $email = $args['email'];
        $password = crypt($args['password'], date('Y/m/d/l'));
        //$profile_image = $args['image'];
        if(empty($profile_image)){$profile_image = "";}
        
        $base->get('DB')->exec('INSERT INTO `users` (`username`, `email`, `password`, `image`) VALUES (:uname,:em,:pass,:img)', [':uname' => $username, ':em' => $email, ':pass' => $password, ':img' => $profile_image]);
        $base->reroute("/", false);
    }
}